    public function testGeneratePdf()
    {
        $data = $this->getMockedData();
        $wkhtmlPath = '/usr/local/bin/wkhtmltopdf';
        $filePath = PdfGenerator::generatePdf($data, $wkhtmlPath, 'file', 'test');

        $this->assertFileExists($filePath);
    }

